css:
* {
  box-sizing: border-box;
}
atom-workspace {
  background-color: #292e36;
  font-weight: normal;
  color: rgba(245, 245, 245, 0.2);
}
.scrollbars-visible-always /deep/ ::-webkit-scrollbar {
  width: 8px;
  height: 8px;
}
.scrollbars-visible-always /deep/ ::-webkit-scrollbar-track,
.scrollbars-visible-always /deep/ ::-webkit-scrollbar-corner {
  background: #22272d;
}
.scrollbars-visible-always /deep/ ::-webkit-scrollbar-thumb {
  background: rgba(92, 92, 92, 0.5);
  border-radius: 4px;
}
.slim-scrollbar .scrollbars-visible-always /deep/ ::-webkit-scrollbar {
  width: 2px;
  height: 2px;
}
.btn,
.settings-view select.form-control {
  background: rgba(245, 245, 245, 0.05);
  box-shadow: none;
  color: rgba(245, 245, 245, 0.6);
  transition: 0.2s ease all;
}
.btn:hover,
.settings-view select.form-control:hover,
.btn:active,
.settings-view select.form-control:active,
.btn:focus,
.settings-view select.form-control:focus,
.btn:active:focus,
.settings-view select.form-control:active:focus {
  background: rgba(245, 245, 245, 0.1);
  outline: none;
  color: #f5f5f5;
}
atom-text-editor .gutter,
atom-text-editor.editor .gutter {
  background: none;
  border: none;
}
atom-text-editor .gutter.drop-shadow {
  -webkit-box-shadow: -2px 0 10px 2px #222222;
}
atom-text-editor.editor .gutter.syntax--drop-shadow {
  -webkit-box-shadow: -2px 0 10px 2px #222222;
}
.status {
  font-weight: normal;
  color: rgba(245, 245, 245, 0.6);
}
.status-added {
  color: #2bda77;
}
.status-ignored {
  font-weight: normal;
  color: rgba(245, 245, 245, 0.2);
}
.status-modified {
  color: #ff982d;
}
.status-removed {
  color: #cc0000;
}
.status-renamed {
  color: #5293d8;
}
.list-group li,
.list-tree li {
  font-weight: normal;
  color: rgba(245, 245, 245, 0.6);
}
.list-group li.text-subtle,
.list-tree li.text-subtle {
  font-weight: normal;
  color: rgba(245, 245, 245, 0.2);
}
.list-group li.text-info,
.list-tree li.text-info {
  color: #5293d8;
}
.list-group li.text-success,
.list-tree li.text-success {
  color: #2bda77;
}
.list-group li.text-warning,
.list-tree li.text-warning {
  color: #ff982d;
}
.list-group li.text-error,
.list-tree li.text-error {
  color: #cc0000;
}
.list-group li.text-selected,
.list-tree li.text-selected {
  font-weight: normal;
  color: #f5f5f5;
}
.list-group li:not(.list-nested-item).status-ignored,
.list-tree li:not(.list-nested-item).status-ignored,
.list-group li.list-nested-item.status-ignored > .list-item,
.list-tree li.list-nested-item.status-ignored > .list-item {
  color: rgba(245, 245, 245, 0.2);
}
.list-group li:not(.list-nested-item).selected.status-ignored,
.list-tree li:not(.list-nested-item).selected.status-ignored,
.list-group li.list-nested-item.selected.status-ignored > .list-item,
.list-tree li.list-nested-item.selected.status-ignored > .list-item {
  color: rgba(245, 245, 245, 0.2);
}
.list-group li:not(.list-nested-item).status-added,
.list-tree li:not(.list-nested-item).status-added,
.list-group li.list-nested-item.status-added > .list-item,
.list-tree li.list-nested-item.status-added > .list-item {
  color: #529b2f;
}
.list-group li:not(.list-nested-item).selected.status-added,
.list-tree li:not(.list-nested-item).selected.status-added,
.list-group li.list-nested-item.selected.status-added > .list-item,
.list-tree li.list-nested-item.selected.status-added > .list-item {
  color: #529b2f;
}
.list-group li:not(.list-nested-item).status-renamed,
.list-tree li:not(.list-nested-item).status-renamed,
.list-group li.list-nested-item.status-renamed > .list-item,
.list-tree li.list-nested-item.status-renamed > .list-item {
  color: #ffd569;
}
.list-group li:not(.list-nested-item).selected.status-renamed,
.list-tree li:not(.list-nested-item).selected.status-renamed,
.list-group li.list-nested-item.selected.status-renamed > .list-item,
.list-tree li.list-nested-item.selected.status-renamed > .list-item {
  color: #ffd569;
}
.list-group li:not(.list-nested-item).status-modified,
.list-tree li:not(.list-nested-item).status-modified,
.list-group li.list-nested-item.status-modified > .list-item,
.list-tree li.list-nested-item.status-modified > .list-item {
  color: #e6b362;
}
.list-group li:not(.list-nested-item).selected.status-modified,
.list-tree li:not(.list-nested-item).selected.status-modified,
.list-group li.list-nested-item.selected.status-modified > .list-item,
.list-tree li.list-nested-item.selected.status-modified > .list-item {
  color: #e6b362;
}
.list-group li:not(.list-nested-item).status-removed,
.list-tree li:not(.list-nested-item).status-removed,
.list-group li.list-nested-item.status-removed > .list-item,
.list-tree li.list-nested-item.status-removed > .list-item {
  color: #fb6060;
}
.list-group li:not(.list-nested-item).selected.status-removed,
.list-tree li:not(.list-nested-item).selected.status-removed,
.list-group li.list-nested-item.selected.status-removed > .list-item,
.list-tree li.list-nested-item.selected.status-removed > .list-item {
  color: #fb6060;
}
.list-group li:not(.list-nested-item).selected,
.list-tree li:not(.list-nested-item).selected,
.list-group li.list-nested-item.selected > .list-item,
.list-tree li.list-nested-item.selected > .list-item {
  font-weight: normal;
  color: #f5f5f5;
}
.select-list .list-group li {
  padding: 10px;
}
.select-list .list-group li .status {
  float: right;
}
.select-list .list-group li.selected {
  background-color: #49483e;
}
.select-list .list-group li.selected:before {
  display: none;
}
.select-list .list-group li.two-lines .secondary-line {
  color: rgba(245, 245, 245, 0.2);
}
.select-list .list-group li.two-lines.selected .secondary-line {
  color: rgba(245, 245, 245, 0.6);
}
.select-list.popover-list {
  background-color: #0000ff;
  box-shadow: 0 0 10px rgba(0, 0, 0, 0.5);
  padding: 1px;
  border-radius: 2px;
  border: 1px solid #008000;
}
.select-list.popover-list atom-text-editor {
  margin-bottom: 1px;
}
.select-list.popover-list .list-group li {
  padding-left: 1px;
}
.ui-sortable li {
  line-height: 2.5;
}
.ui-sortable li.ui-sortable-placeholder {
  visibility: visible !important;
  background-color: #1e2228;
}
li.ui-draggable-dragging,
li.ui-sortable-helper {
  line-height: 25px;
  height: 25px;
  border: 0;
  border-radius: 0;
  list-style: none;
  padding: 0 2px;
  background: rgba(255, 255, 255, 0.07);
  box-shadow: 0 0 1px rgba(0, 0, 0, 0.5);
}
atom-panel.modal,
.overlay {
  color: rgba(245, 245, 245, 0.6);
  padding: 0;
  background-color: #292e36;
  border: none;
  box-shadow: 0 0 100px rgba(0, 0, 0, 0.5), 0 0 0 1000px rgba(0, 0, 0, 0.1);
}
.panel.bordered {
  border: 1px solid rgba(0, 0, 0, 0.5);
  border-radius: 2px;
}
atom-panel,
.tool-panel {
  position: relative;
  background: #292e36;
}
atom-panel.bottom {
  background: #22272d;
  font-weight: normal;
  color: rgba(245, 245, 245, 0.6);
}
atom-panel.bottom .inline-block {
  padding: 0 5px;
}
atom-pane-container atom-pane .item-views .pane-item {
  background: none;
}
.tab-bar {
  height: 44px;
  background: #22272d;
  overflow-x: auto;
  overflow-y: hidden;
}
.tab-bar::-webkit-scrollbar {
  display: none;
}
.tab-bar .tab {
  position: relative;
  max-width: 160px;
  height: 44px;
  padding: 0 10px;
  background: transparent;
  color: rgba(245, 245, 245, 0.6);
  line-height: 44px;
  transition: color 0.1s ease-in;
}
.tab-bar .tab .title {
  position: relative;
  z-index: 1;
  padding-right: 10px;
}
.tab-bar .tab .close-icon {
  right: 10px;
  z-index: 3;
  text-align: right;
  line-height: 44px;
  color: rgba(245, 245, 245, 0.6);
}
.tab-bar .tab .close-icon:hover {
  color: inherit;
}
.tab-bar .tab:hover {
  color: #f5f5f5;
}
.tab-bar .tab.active {
  z-index: 1;
  background: #292e36;
  color: #f5f5f5;
}
.tab-bar .tab.active .close-icon {
  line-height: 43px;
  color: rgba(245, 245, 245, 0.6);
}
.tab-bar .tab.modified:hover .close-icon:hover {
  color: #f5f5f5;
}
.tab-bar .tab.modified:not(:hover) .close-icon {
  right: 10px;
  top: 19px;
  width: 8px;
  height: 8px;
}
.tab-bar .placeholder {
  width: 20px;
  height: 44px;
  margin-left: -10px;
  pointer-events: none;
  background: green;
}
.tab-bar .placeholder:after {
  top: 42px;
}
.tree-view {
  background: #22272d;
}
.tree-view .project-root:before {
  height: 44px;
}
.tree-view .project-root.selected:before {
  background: transparent;
}
.tree-view .project-root > .header {
  line-height: 44px !important;
}
.tree-view .selected:before {
  background: #292e36;
}
.tree-view-resizer .tree-view-resize-handle {
  width: 8px;
  background: transparent;
  transition: 0.2s ease all;
}
.tree-view-resizer .tree-view-resize-handle:hover {
  width: 12px;
  background: #171a1f;
}
[data-show-on-right-side=true] .tree-view .selected:before,
[data-show-on-right-side=true] .focusable-panel {
  box-shadow: inset 3px 0 0 rgba(0, 0, 0, 0.05);
}
.key-binding {
  display: inline-block;
  line-height: 100%;
  border-radius: 2px;
  margin-left: 5px;
  font-family: Helvetica, Arial, sans-serif;
  font-size: 10px;
  padding: 1px;
}
.badge {
  font-weight: normal;
  color: #f5f5f5;
  background: rgba(255, 255, 255, 0.07);
}
.settings-view .section {
  border-top: 5px solid #22272d;
}
.settings-view .section,
.settings-view .section:first-child,
.settings-view .section:last-child {
  padding: 40px;
}
.settings-view .sub-section {
  margin: 40px 0;
}
.settings-view .config-menu {
  background: #22272d;
  border: none;
}
.settings-view .config-menu .nav > li.active > a {
  background: #292e36;
}
.settings-view .package-card {
  padding: 10px;
  border: none;
}
